import Layout from "../components/layout";
import Evaluate from "../components/Evaluate";

const Test = () => (
  <Layout>
    <div>
      <h1>Test for Corona</h1>
      <p>Answer the question below.</p>
      <br/>
      <Evaluate/>
    </div>
  </Layout>
);

export default Test;
